  [],\n\t\"revision_timestamp\": \"2016-08-04T08:18:35.743749\",\n\t\"name\": \"kodiak-national-wildlife-refuge-annual-narrative-report-calendar-year-1991\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Kodiak
  NWR outlines Refuge accomplishments during the 1991 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses management planning
  and research and investigations. Refuge administration is outlined; information
  about personnel, volunteer programs, funding, safety, and technical assistance is
  given. Habitat management is also covered; subjects include wilderness areas. The
  wildlife section of the report discusses waterfowl, marsh birds and waterbirds,
  shorebirds, raptors, game mammals, and fisheries resources. The public uses of the
  Refuge described in this report include outdoor classrooms, interpretive programs,
  fishing, trapping, and law enforcement. The equipment and facilities section of
  the report provides information about equipment replacement, communication systems,
  and computer systems.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
